      <style data-savepage-href="main.css">fbs-carousel {
	display: block
}

.fbs-slider {
	position: relative;
	width: 100%;
	max-width: 100%
}

.fbs-slider--initialized .fbs-slider__controls {
	display: block
}

.fbs-slider--initialized .fbs-slider__slide {
	float: left;
	overflow: hidden;
	min-height: 1px
}

.fbs-slider--no-controls .fbs-slider__controls {
	display: none
}

.fbs-slider__slides-wrapper {
	margin: 0 80px;
	overflow: hidden
}

.fbs-slider__slides {
	-webkit-transition: none;
	-o-transition: none;
	transition: none
}

.fbs-slider__slides.is-animating {
	-webkit-transition: all .5s ease;
	-o-transition: all .5s ease;
	transition: all .5s ease
}

.fbs-slider__controls {
	display: none
}

.fbs-slider__controls button {
	color: #fff;
	position: absolute;
	height: 64px;
	width: 64px;
	top: 45%;
	cursor: pointer;
	background: #181716;
	-webkit-border-radius: 50%;
	border-radius: 50%;
	display: -webkit-box;
	display: -webkit-flex;
	display: -ms-flexbox;
	display: flex;
	-webkit-box-pack: center;
	-webkit-justify-content: center;
	-ms-flex-pack: center;
	justify-content: center;
	opacity: .7;
	-webkit-box-shadow: 0 0 50px rgba(0, 0, 0, .2);
	box-shadow: 0 0 50px rgba(0, 0, 0, .2)
}

.fbs-slider__controls button.disabled {
	color: #ccc
}

.fbs-slider__controls .fbs-slider__control-left {
	left: 30px
}

.fbs-slider__controls .fbs-slider__control-right {
	right: 30px
}

.fbs-slider__controls .fs-icon {
	fill: currentColor;
	width: 24px
}

@media (max-width:1023px) and (min-width:769px) {
	.fbs-slider__controls .fbs-slider__control-left {
		left: 15px
	}
	.fbs-slider__controls .fbs-slider__control-right {
		right: 15px
	}
}

fbs-accordion>* {
	overflow: hidden
}

fbs-accordion [aria-expanded=false] {
	height: 1em
}

fbs-accordion [aria-expanded=true] {
	height: 100%
}

fbs-embedly {
	display: block;
	height: 0;
	margin: 0;
	overflow: hidden;
	padding-bottom: 67.5%;
	position: relative;
	width: 100%
}

fbs-embedly iframe {
	border: 0;
	height: 100%;
	left: 0;
	position: absolute;
	top: 0;
	width: 100%
}

fbs-pricing {
	display: block
}

fbs-pricing div {
	-webkit-box-align: center;
	-webkit-align-items: center;
	-ms-flex-align: center;
	align-items: center;
	display: -webkit-inline-box;
	display: -webkit-inline-flex;
	display: -ms-inline-flexbox;
	display: inline-flex
}

fbs-pricing .fbs-pricing__regular-price,
fbs-pricing .fbs-pricing__sale-price {
	color: #333;
	font-size: 20px;
	font-weight: 600;
	margin-right: 5px
}

fbs-pricing .fbs-pricing__sale-price+.fbs-pricing__regular-price {
	font-weight: 400;
	text-decoration: line-through
}

fbs-pricing .fbs-pricing__savings {
	color: #d5384d;
	font-size: 14px;
	font-weight: 600;
	margin-left: 5px;
	text-transform: uppercase
}

@media (max-width:480px) {
	fbs-pricing .fbs-pricing__regular-price,
	fbs-pricing .fbs-pricing__sale-price {
		font-size: 16px
	}
	fbs-pricing .fbs-pricing__savings {
		font-size: 12px
	}
}

fbs-cordial {
	vertical-align: middle
}

fbs-cordial .follow-button,
fbs-cordial .unfollow-button {
	background-color: #fff;
	border: 1px solid #737373;
	-webkit-border-radius: 1px;
	border-radius: 1px;
	color: #333;
	font: normal 12px/2.3 Work Sans, sans-serif;
	padding: 2px 16px
}

fbs-cordial .follow-button {
	background-color: #4384f4;
	border-color: #4384f4;
	color: #fff
}

@media (hover) {
	fbs-cordial .follow-button:hover {
		opacity: .7
	}
}


